import VeuRouter from 'vue-router'

import Situations from "@/pages/Situations";
import AddSituations from "@/pages/AddSituatins"

export default new VeuRouter({
    routes: [
        {
            path: '/',
            component: Situations
        },
        {
            path: '/AddSituations',
            component: AddSituations
        }
    ]
})
